import React, { Component } from "react";

class Emulator extends Component {
  render() {
    return (
      <Emulator
        id="flow"
        rows={rows}
        cols={cols}
        text={text}
        style={style}
        cursor={cursor}
        readOnly
      />
    );
  }
}
export default Emulator;
